INSERT INTO `node_type` VALUES ('page','Page','node','A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an \"About us\" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site\'s initial home page.','',1,'Title',1,'Body',0,1,1,0,'page'),('story','Story','node','A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site\'s initial home page, and provides the ability to post comments.','',1,'Title',1,'Body',0,1,1,0,'story'),('organization','Organization','node','An Organization looking for volunteers. ','',1,'Title',1,'Body',0,1,1,0,''),('hackunteer','Hackunteer','node','Describe a hackunteer user','',1,'Handle',1,'Bio',0,1,1,0,'profile'),('feed','Feed','node','Items from these feeds will be turned into nodes.','',1,'Title',1,'Body',0,1,1,0,'feed'),('project','Project','node','I project that Needs Volunteers','',1,'Title',1,'Body',0,1,1,0,''),('panel','Panel','panels_node','A panel a page layout broken up into rows and columns.','',1,'Title',1,'Teaser',0,0,0,1,'panel');
